import React from 'react';
import { Alert } from 'react-bootstrap'; // Importing from React Bootstrap

function Dashboard() {
  return (
    <div>
      <Alert variant="success">
        This is a success alert!
      </Alert>
    </div>
  );
}

export default Dashboard;
